import React from "react";
import { Map, MapMarker } from "react-kakao-maps-sdk";

const Chan = (props) => {
  return (
    <div>
      <nav>
        <Link to="me">My Profile</Link>
      </nav>

      <Routes>
        <Route path=":id" element={<UserProfile />} />
        <Route path="me" element={<OwnUserProfile />} />
      </Routes>
    </div>
  );
};

export default Chan;
